import './Button.css';
import { useNavigate } from 'react-router-dom';

// ReturnBtnConnexion view available
export default function ReturnBtnConnexion() {

 const navigation = useNavigate();
 const handlepath = (event) => {
  event.preventDefault();
  navigation('/sign');
 };

 return (
  <div onClick={handlepath} className='btn-connexion-body'>
   <p>
    Connexion Client
   </p>
  </div>
 );
};
